.
Sigla em inglês para designar Aminoácidos de Cadeia Ramificada, composto por leucina, isoleucina e valina. Treinamentos intensos, repetidos por dias ou semanas, podem levar à fadiga, imunossupressão e overtraining, se o atleta não se recuperar adequadamente entre as sessões de treinamento.
.
A suplementação a longo prazo com BCAA demonstrou melhorar a resposta imunológica à várias semanas de treinamento intenso.
Como?
.
Pesquisadores descobriram que os BCAAs também podem ser usados por células imunes dentro do intestino como fonte de combustível, o que permite que o sistema imunológico se regenere de forma mais eficiente e proteja contra patógenos nocivos. Um sistema imunológico forte ajuda na recuperação e torna menos provável que você fique doente.
